

def check(letterCombos, test):
    for elem in letterCombos: 
        if elem in test:
            return False
    return True


def find_length(letterCombos, test):
    while(not check(letterCombos, test)):
        for elem in letterCombos: 
            if elem in test:
                test = test[:test.index(elem)] + test[test.index(elem)+2:]
    return len(test)
          


